script: |
  super -f text -I q4853.spq | sort > q4853.out

inputs:
  - name: q4853.spq
    data: |
      SELECT - ( col2 ) / 5 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col0 NOT IN ( + - 54 * col0 * - 58 + + 75 * col0 + - CAST ( NULL AS INTEGER ) + 35 * - + col1 );
  - name: tab2

outputs:
  - name: q4853.out
    data: |
